import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import Card from "./Card";
import reportWebVitals from "./reportWebVitals";
import "tachyons"; //dependecia que permite poner estilos como por ej "bg-light-green"
import { robots } from "./robots";

ReactDOM.render(
  <div>
    <Card
      id={robots[0].id}
      name={robots[0].nombre}
      email={robots[0].descripcion}
    />
    <Card
      id={robots[1].id}
      name={robots[1].nombre}
      email={robots[1].descripcion}
    />
    <Card
      id={robots[2].id}
      name={robots[2].nombre}
      email={robots[2].descripcion}
    />
  </div>,
  document.getElementById("root")
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
